  let news;
  await axios.get(`http://localhost:8080/api/news/findAllNewsWithIssuesById/${id}`).then(
    (response) => {
       console.log(response)
      news=response.data.news;
      
    },
    (error) => {
      console.log(error);
    }
  
  );
  return news;
}




